class Solution:
    def minOperations(self, s1: str, s2: str, x: int) -> int:
        n = len(s1)
        diff_pairs = 0
        for i in range(n):
            if s1[i] != s2[i]:
                diff_pairs += 1
        if diff_pairs % 2 != 0:
            return -1
        swap_needed = diff_pairs // 2
        if x > 1:
            adj_diff = 0
            for i in range(n - 1):
                if s1[i] != s2[i] and s1[i + 1] != s2[i + 1] and s1[i] != s1[i + 1]:
                    adj_diff += 1
            if adj_diff >= swap_needed:
                return swap_needed
            else:
                return adj_diff + (swap_needed - adj_diff) * x
        else:
            return swap_needed
